# чтение файла bank_dataset.csv с данными и сохранение

try:
    data = pd.read_csv('https://code.s3.yandex.net/datasets/bank_dataset.csv')
except:
    data = pd.read_csv('/datasets/bank_dataset.csv')

# вызовем метод corr(), чтобы найти коэффициент корреляции для всех столбцов, и построим тепловую карту:

plt.figure(figsize=(16,8))
sns.heatmap (data.corr(), annot=True,  cmap= 'coolwarm', fmt='.2%', linewidths=1);

# построим столбчатые диаграммы и посмотрим в разрезе городов

for i in range(len(['city_new'])):
    data_new = data.pivot_table(index=['city_new'], columns='products', values='user_id', aggfunc='count')
    data_new['sum'] = data_new.sum(axis=1)
    for b in range(1,5):
        data_new[b] = data_new[b] / data_new['sum']
    data_new.iloc[:,0:4].plot(kind='bar', figsize=(12, 7), grid=True, 
                          title='Сравнение числа клиентов и потребляемых ими продуктов по городам ')
    ax = plt.gca()
    ax.set_xticklabels(['Ярославль', 'Ростов Великий', 'Рыбинск'], rotation = 0);

# построим столбчатые диаграммы и посмотрим в разрезе пола

for i in range(len(['gender'])):
    data_new = data.pivot_table(index=['gender'], columns='products', values='user_id', aggfunc='count')
    data_new['sum'] = data_new.sum(axis=1)
    for b in range(1,5):
        data_new[b] = data_new[b] / data_new['sum']
    data_new.iloc[:,0:4].plot(kind='bar', figsize=(12, 7), grid=True, 
                          title='Сравнение числа клиентов и потребляемых ими продуктов в зависимости от пола')
    ax = plt.gca()
    ax.set_xticklabels(['М', 'Ж'], rotation = 0);

# построим столбчатые диаграммы и посмотрим в разрезе наличия кредитной карты

for i in range(len(['credit_card'])):
    data_new = data.pivot_table(index=['credit_card'], columns='products', values='user_id', aggfunc='count')
    data_new['sum'] = data_new.sum(axis=1)
    for b in range(1,5):
        data_new[b] = data_new[b] / data_new['sum']
    data_new.iloc[:,0:4].plot(kind='bar', figsize=(12, 7), grid=True, 
                          title='Сравнение числа клиентов и потребляемых ими продуктов в зависимости от наличия кредитной карты')
    ax = plt.gca()
    ax.set_xticklabels(['true', 'false'], rotation = 0);

# построим столбчатые диаграммы и посмотрим в разрезе активности

for i in range(len(['loyalty'])):
    data_new = data.pivot_table(index=['loyalty'], columns='products', values='user_id', aggfunc='count')
    data_new['sum'] = data_new.sum(axis=1)
    for b in range(1,5):
        data_new[b] = data_new[b] / data_new['sum']
    data_new.iloc[:,0:4].plot(kind='bar', figsize=(12, 7), grid=True, 
                          title='Сравнение числа клиентов и потребляемых ими продуктов в зависимости от активности')
    ax = plt.gca()
    ax.set_xticklabels(['true', 'false'], rotation = 0);
